import styled from 'styled-components'

const Wrapper = styled.main`
  text-align: center;
  display: flex;
  align-items: center;
  justify-content: center;
  h3 {
    margin-bottom: 0.5rem;
  }
  p {
    margin-top: 0;
    margin-bottom: 0.5rem;
    color: black;
  }
  a {
   color:#008080;
    text-decoration: underline;
    text-transform: capitalize;
  }
`

export default Wrapper
